// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.9;
contract CampaignFactory {
    TwoTierCampaign[] public deployedCampaigns;


    function createCampaign(uint256 minimum, uint256 rewardPercentage, uint256 tierTwoContribution) public {
        require(
            rewardPercentage >= 0 && rewardPercentage<=100,
            "rewardPercentage should be in range [0-100]."
        );
        require(
            tierTwoContribution>minimum,
            "tierTwoContribution should be more than minimumContribution"
        );
        TwoTierCampaign newCampaign = new TwoTierCampaign(minimum, msg.sender, rewardPercentage, tierTwoContribution);
        deployedCampaigns.push(newCampaign);
    }

    function getDeployedCampaigns() public view returns (TwoTierCampaign[] memory) {
        return deployedCampaigns;
    }
}

contract TwoTierCampaign {
    struct Request {
        string description;
        uint256 value;
        address payable recipient;
        bool complete;
        uint256 approvalCount;
        mapping(address => bool) approvals;
    }

    address public manager;
    uint256 public minimumContribution;
    mapping(address => bool) public approvers;
    uint256 public approversCount;
    uint256 public numRequests;
    mapping(uint256 => Request) public requests;
    uint256 public rewardPercentage;
    address payable [] public contributors;
    mapping(address => uint256) contributions;
    uint256 public tier1Counter;
    uint256 public tier2Counter;
    uint256 public tierTwoContribution;
    mapping(address => uint256) public contributorTier;
    mapping(address => mapping(uint256 => uint256)) public requestContributions;

    modifier onlyManager() {
        require(
            msg.sender == manager,
            "Only the campaign manager can call this function."
        );
        _;
    }

    constructor(uint256 minimum, address creator, uint256 rewardPercent, uint256 tier2Amount) {
        manager = creator;
        minimumContribution = minimum;
        rewardPercentage=rewardPercent;
        tierTwoContribution=tier2Amount;
    }

    function contribute() public payable {
        require(
            msg.value/1000000000000000000.0 >= minimumContribution,
            "A minumum contribution is required."
        );
        approvers[msg.sender] = true;
        approversCount++;
        contributors.push(payable(msg.sender));
        contributions[msg.sender]=msg.value;
        if(msg.value/1000000000000000000.0 >= tierTwoContribution){
            tier2Counter++;
            contributorTier[msg.sender]=2;
        }
        else {
            tier1Counter++;
            contributorTier[msg.sender]=1;
        }

    }

    function createRequest(
        string memory description,
        uint256 value,
        address payable recipient
    ) public onlyManager {
        Request storage newRequest = requests[numRequests++];
        newRequest.description = description;
        newRequest.value = value;
        newRequest.recipient = recipient;
        newRequest.complete = false;
        newRequest.approvalCount = 0;
    }

    function approveRequest(uint256 index) public {
        Request storage request = requests[index];
        require(
            approvers[msg.sender],
            "Only contributors can approve a specific request"
        );
        require(
            !request.approvals[msg.sender],
            "You have already voted to approve this request"
        );

        request.approvals[msg.sender] = true;
        if(contributorTier[msg.sender]==1)
            request.approvalCount++;
        else
            request.approvalCount+=2;

    }

    function finalizeRequest(uint256 index) public onlyManager {
        Request storage request = requests[index];
        require(
            //my code actually works correctly here with > and not >=
            request.approvalCount > (approversCount / 2.0),
            "This request needs more approvals before it can be finalized"
        );
        require(
            !(request.complete),
            "This request has already been finalized"
        );

        request.recipient.transfer(request.value*1000000000000000000.0);
        request.complete = true;
    }

    function getSummary()
        public
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256,
            address
        )
    {
        return (
            minimumContribution,
            address(this).balance,
            numRequests,
            approversCount,
            manager
        );
    }

    function getContribution(address account) public view returns (uint256) {
        return (contributions[account]/1000000000000000000.0);
    }

    function payRewards() public onlyManager {
        for (uint i = 0; i < contributors.length; i++){
            contributors[i].transfer(contributions[contributors[i]]*rewardPercentage/100.0);
        }
    }

    function setRequestContribution(uint256 index) public payable {
        require(
            approvers[msg.sender],
            "donor should have already contributed to this campaign"
        );
        requestContributions[msg.sender][index]=msg.value;

    }

    function getRequestContribution(address account, uint256 index) public view onlyManager returns (uint256){
        return (requestContributions[account][index]/1000000000000000000.0);
    }

}

